import styles from "./Nav.module.css";
import logo from "./Logo.png";
import { useStateValue } from "../Stateprovider";

const Nav = () => {
  const [{ listing_result }, dispatch] = useStateValue();
  return (
    <div className={styles.nav}>
      <img src={logo} alt="" />
      <div className={styles.logIn}>
        <span> </span>
      </div>
    </div>
  );
};

export default Nav;
